    "contracts/DoitRingDevice.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "./utils/VerifiableUpgradeable.sol";
import "./utils/BidirectionalTransfer.sol";
import "./utils/ProxyForwardUpgradeable.sol";

contract DoitRingDevice is ProxyForwardUpgradeable, VerifiableUpgradeable, BidirectionalTransfer, UUPSUpgradeable, OwnableUpgradeable {

  /// @custom:oz-upgrades-unsafe-allow constructor
  constructor() { _disableInitializers(); }
  function _authorizeUpgrade(address) internal override onlyOwner {}

  struct DeviceMapping {
    uint256 timestamp;
    int256 height;
    string sncode;
  }

  struct TokenMapping {
    address token;
    uint256 tokenId;
  }

  struct Reward {
    address token;
    uint256 amount;
  }

  mapping(address => string) private AddressMapDevice;
  mapping(string => TokenMapping) private DeviceMapToken;
  mapping(address => mapping(uint256 => DeviceMapping)) private TokenMapDevice;

  mapping(string => bool) private ClaimIDsMapClaimed;

  error DeviceRegistered();
  error DeviceUnregistered();
  error DeviceEmpty();
  error ClaimInvalidClaimed();
  error ERC721IncorrectOwner();

  event Claimed(
    address indexed token,
    uint256 indexed tokenId,
    string uid,
    string sncode,
    address to,
    Reward[] rewards,
    string memo,
    int256 blockHeight,
    uint256 timestamp
  );

  event Registered(
    address indexed token,
    uint256 indexed tokenId,
    address indexed sender,
    string sncode,
    int256 blockHeight,
    uint256 timestamp
  );

  event Binded(
    address indexed owner,
    string sncode,
    int256 blockHeight,
    uint256 timestamp
  );


  function initialize(address _owner, address _verifier) public initializer {
    __Ownable_init(_owner);
    __Proxyed_init(_owner);
    __Verifie_init(_verifier);
    __UUPSUpgradeable_init();
  }

  function register(address sender, address token, uint256 tokenId, string memory sncode) public proxy(sender) {
    if (IERC721(token).ownerOf(tokenId) != sender)
      revert ERC721IncorrectOwner();
    if (bytes(sncode).length == 0)
      revert DeviceEmpty();
    if (DeviceMapToken[sncode].token != address(0))
      revert DeviceRegistered();

    TokenMapDevice[token][tokenId] = DeviceMapping(block.timestamp, int(block.number), sncode);
    DeviceMapToken[sncode] = TokenMapping(token, tokenId);
    
    emit Registered(
      token,
      tokenId,
      sender,
      sncode, 
      int(block.number), 
      block.timestamp
    );

    AddressMapDevice[sender] = sncode;

    emit Binded(sender, sncode, int(block.number), block.timestamp);
  }

  function rebind(address sender, string memory sncode) public proxy(sender) {
    if (bytes(sncode).length == 0)
      revert DeviceEmpty();
    if (DeviceMapToken[sncode].token == address(0))
      revert DeviceUnregistered();
    if (IERC721(DeviceMapToken[sncode].token)
       .ownerOf(DeviceMapToken[sncode].tokenId) != msg.sender)
      revert ERC721IncorrectOwner();

    AddressMapDevice[msg.sender] = sncode;

    emit Binded(msg.sender, sncode, int(block.number), block.timestamp);
  }

  function claim(
    address sender,
    string memory uid,
    string memory sncode,
    Reward[] memory rewards,
    bytes memory signature, 
    string memory memo
  ) public proxy(sender) {
    TokenMapping memory tmapping = DeviceMapToken[sncode];
    if (tmapping.token == address(0))
      revert DeviceUnregistered();
    if (IERC721(tmapping.token).ownerOf(tmapping.tokenId) != sender)
      revert ERC721IncorrectOwner();
    if (ClaimIDsMapClaimed[uid])
      revert ClaimInvalidClaimed();

    bytes32 rewardsHash = keccak256(abi.encode(rewards));
    verify(abi.encodePacked(uid, sender, sncode, rewardsHash), signature);

    ClaimIDsMapClaimed[uid] = true;

    for (uint256 i = 0; i < rewards.length; i++) {
      if (rewards[i].amount > 0)
        transfer(
          address(this),
          sender,
          rewards[i].token, 
          rewards[i].amount
        );
    }
    
    emit Claimed(
      tmapping.token,
      tmapping.tokenId, 
      uid,
      sncode,
      sender, 
      rewards,
      memo,
      int(block.number),
      block.timestamp
    );
  }

  function getTokenInAddress(address user) public view returns (TokenMapping memory) {
    return DeviceMapToken[AddressMapDevice[user]];
  }

  function getTokenInDevice(string memory sncode) public view returns (TokenMapping memory) {
    return DeviceMapToken[sncode];
  }

  function getDeviceInToken(address token, uint256 tokenId) public view returns (DeviceMapping memory) {
    return TokenMapDevice[token][tokenId];
  }

  function getDeviceInAddress(address user)  public view returns (string memory) {
    return AddressMapDevice[user];
  }
  
  function existsBinded(address token, uint256 tokenId) public view returns (bool) {
    return bytes(getDeviceInToken(token, tokenId).sncode).length != 0;
  }

  function withdraw(address token, uint256 amount) public onlyOwner() {
    transfer(address(this), msg.sender, token, amount);
  }

  function __migrate_Claimed(
    address token, uint256 tokenId, string memory uid, string memory sncode,
    address to, Reward[] memory rewards, string memory memo,
    int256 blockHeight, uint256 timestamp
  ) public onlyOwner {
    ClaimIDsMapClaimed [uid] = true;
    emit Claimed(
      token,
      tokenId,
      uid,
      sncode,
      to,
      rewards,
      memo,
      blockHeight,
      timestamp
    );
  }

  function __migrate_Registered(
    address token, uint256 tokenId, address sender,
    string memory sncode, int256 blockHeight, uint256 timestamp
  ) public onlyOwner {
    TokenMapDevice[token][tokenId] = DeviceMapping(timestamp, blockHeight, sncode);
    DeviceMapToken[sncode] = TokenMapping(token, tokenId);
    AddressMapDevice[sender] = sncode;
    emit Registered(
      token,
      tokenId,
      sender,
      sncode,
      blockHeight,
      timestamp
    );
    emit Binded(sender, sncode, blockHeight, timestamp);
  }
}
"
    },
    "contracts/DoitRingFriend.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721URIStorageUpgradeable.sol";
import "./utils/VerifiableUpgradeable.sol";
import "./utils/ProxyForwardUpgradeable.sol";

contract DoitRingFriend is VerifiableUpgradeable, ProxyForwardUpgradeable, ERC721URIStorageUpgradeable, UUPSUpgradeable, OwnableUpgradeable {
  uint256 private _tokenIds;

  /// @custom:oz-upgrades-unsafe-allow constructor
  constructor() { _disableInitializers(); }
  function _authorizeUpgrade(address) internal override onlyOwner {}

  mapping(address => uint256) public userToGroup;

  event GroupCreated(
    address indexed creator,
    uint256 group,
    string tokenURI,
    uint256 timestamp
  );
  event GroupJoined(
    address indexed user,
    uint256 group,
    uint256 timestamp
  );
  event GroupLeaved(
    address indexed user,
    uint256 group,
    uint256 timestamp
  );

  error UserAlreadyInGroup();
  error UserNotInGroup();

  function initialize(address _owner, address _verifier) public initializer {
    __Ownable_init(_owner);
    __Proxyed_init(_owner);
    __Verifie_init(_verifier);
    __UUPSUpgradeable_init();
    _tokenIds = 1;
  }

  function create(address signer, string memory tokenURI, bytes memory signature) public proxy(signer) {
    verify(abi.encodePacked(signer, tokenURI), signature);

    uint256 groupId = mint(signer, tokenURI);

    userToGroup[signer] = groupId;
    emit GroupCreated(signer, groupId, tokenURI, block.timestamp);
    emit GroupJoined(signer, groupId, block.timestamp);
  }

  function join(address signer, uint256 groupId, bytes memory signature) public proxy(signer) {
    verify(abi.encodePacked(signer, groupId), signature);
    if (userToGroup[signer] != 0) {
      revert UserAlreadyInGroup();
    }

    userToGroup[signer] = groupId;
    emit GroupJoined(signer, groupId, block.timestamp);
  }

  function leave(address signer) public proxy(signer) {
    if (userToGroup[signer] == 0) {
      revert UserNotInGroup();
    }

    uint256 groupId = userToGroup[signer];
    delete userToGroup[signer];
    emit GroupLeaved(signer, groupId, block.timestamp);
  }

  function group(address user) public view returns(uint256) {
    return userToGroup[user];
  }

  function mint(address user, string memory tokenURI) internal returns (uint256) {
    uint256 newItemId = _tokenIds;
    _safeMint(user, newItemId);
    _setTokenURI(newItemId, tokenURI);
    _tokenIds++;
    return newItemId;
  }
  
  function _baseURI() internal pure override returns (string memory) {
    return "https://gateway.pinata.cloud/ipfs/";
  }
}"
    },
    "contracts/DoitRingStaked.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

import "./utils/VerifiableUpgradeable.sol";
import "./utils/ProxyForwardUpgradeable.sol";
import "./utils/BidirectionalTransfer.sol";

contract DoitRingStaked is VerifiableUpgradeable, ProxyForwardUpgradeable, BidirectionalTransfer, UUPSUpgradeable, OwnableUpgradeable {

  /// @custom:oz-upgrades-unsafe-allow constructor
  constructor() { _disableInitializers(); }
  function _authorizeUpgrade(address) internal override onlyOwner {}

  uint256 locking;
  mapping(address => Stake[]) public Stakes;
  mapping(address => mapping(uint128 => uint256)) public Cancells;

  error StakeEmpty();
  error StakeAmountEmpty();
  error StakeCancelEmpty();
  error StakeCancelUnexpired();
  
  event StakeCreated(
    address indexed staker,
    uint indexed index,
    address token,
    uint amount,
    uint timestamp
  );

  event StakeCancelled(
    address indexed staker,
    uint indexed index,
    address token,
    uint amount,
    uint timestamp
  );

  event StakeClaimed(
    address indexed staker,
    uint indexed index,
    address token,
    uint amount,
    uint timestamp
  );

  struct Stake {
    uint index;
    address staker;
    address token;
    uint amount;
    uint timestamp;
  }

  function initialize(address _owner) public initializer {
    __Ownable_init(_owner);
    __Proxyed_init(_owner);
    __UUPSUpgradeable_init();
    locking = 30 * 86400;
  }

  function create(address sender, address token, uint amount) public proxy(sender) {
    if (amount == 0)
      revert StakeAmountEmpty();

    uint index = Stakes[sender].length;

    Stake memory stake = Stake(index, sender, token, amount, block.timestamp);
    Stakes[sender].push(stake);

    transfer(sender, address(this), token, amount);

    emit StakeCreated(
      sender,
      index,
      token,
      amount,
      block.timestamp
    );
  }

  function cancel(address sender, uint128 index) public proxy(sender) {
    if (Stakes[sender][index].amount == 0)
      revert StakeEmpty();

    Cancells[sender][index] = block.timestamp + locking;

    emit StakeCancelled(
      sender,
      index,
      Stakes[sender][index].token, 
      Stakes[sender][index].amount,
      block.timestamp
    );
  }

  function claim(address sender, uint128 index) public proxy(sender) {
    if (Stakes[sender][index].amount == 0)
      revert StakeEmpty();
    if (Cancells[sender][index] == 0)
      revert StakeCancelEmpty();
    if (Cancells[sender][index] > block.timestamp)
      revert StakeCancelUnexpired();

    transfer(
      address(this),
      sender,
      Stakes[sender][index].token,
      Stakes[sender][index].amount
    );

   emit StakeClaimed(
      sender,
      index,
      Stakes[sender][index].token, 
      Stakes[sender][index].amount, 
      block.timestamp
    );

    delete Stakes[sender][index];
    delete Cancells[sender][index];
  }

  function stakes(address owner) public view returns(Stake[] memory) {
    return Stakes[owner];
  }

  function status(address owner, uint128 index) public view returns(uint16) {
    if (Cancells[owner][index] != 0) {
      if (Cancells[owner][index] > block.timestamp)
        return 3;
      else
        return 2;
    }
    if (Stakes[owner][index].amount != 0)
      return 1;
    else
      return 0;
  }

  function length(address owner) public view returns(uint256) {
   return Stakes[owner].length;
  }

  function expiration(address owner, uint128 index) public view returns(uint256) {
    return Cancells[owner][index];
  }

  function exists(address owner, uint128 index) public view returns(bool) {
    return Stakes[owner][index].amount != 0;
  }

  function setLocking(uint256 duration) public onlyOwner() {
    locking = duration;
  }

  function __migrate_stakes(address owner, Stake[] memory stakes_) public onlyOwner() {
    delete Stakes[owner];
    for (uint256 index = 0; index < stakes_.length; index++) {
      Stakes[owner].push(stakes_[index]);
    }
  }
  
  function __migrate_StakeCreated(address owner, uint256 index, address token, uint amount, uint timestamp) public onlyOwner() {
    emit StakeCreated(
      owner,
      index,
      token,
      amount,
      timestamp
    );
  }

  function __migrate_StakeCancelled(address owner, uint256 index, address token, uint amount, uint timestamp) public onlyOwner() {
    emit StakeCancelled(
      owner,
      index,
      token,
      amount,
      timestamp
    );
  }

  function __migrate_StakeClaimed(address owner, uint256 index, address token, uint amount, uint timestamp) public onlyOwner() {
    emit StakeClaimed(
      owner,
      index,
      token,
      amount,
      timestamp
    );
  }
}"
